import React from 'react';
import './header.css';
import { AppBar, Toolbar, IconButton, Typography, Button} from '@material-ui/core';

export default function header() {
  return (
    <div className="div_header">
      <AppBar title="My App">
        <Tabs>
          <Tab label="Item 1" />
          <Tab label="Item 2" />
          <Tab label="Item 3" />
          <Tab label="Item 4" />
        </Tabs>
      </AppBar></div>
  );
}
